import React, { Component } from "react";
import { Link } from "react-router-dom";
import { Menu, Divider } from "semantic-ui-react";
import RankIcon from "../components/ProfileMenuItem.js";

class Navbar extends Component {
  render() {
    return (
      <div>
        <Menu pointing>
          <Link to="/home">
            <Menu.Item name="home" />
          </Link>
          <Link to="/record">
            <Menu.Item name="record" />
          </Link>
          <Link to="/history">
            <Menu.Item name="history" />
          </Link>
          <Menu.Menu position="right">
            <Link to="/profile">
              <RankIcon className="navbar" />
            </Link>
            <Divider />
            <Divider />
            <Link to="/login">
              <Menu.Item
                name="logout"
                onClick={e => {
                  localStorage.clear();
                }}
              />
            </Link>
          </Menu.Menu>
        </Menu>
      </div>
    );
  }
}
export default Navbar;
